import React from "react";
import OnClick from "onclick.js";
function ButtonUse() {
  return (
    <div>
      <input
        placeholder="https://linkedin.com"
        type="url"
        id="linkedinUrl"
        classname="inputs"
      ></input>
      <br></br>
      <OnClick />
      <button type="button" onclick="OnClick(linkedinUrl)">
        Start
      </button>
    </div>
  );
}

export default ButtonUse;
